// File: src/components/ProfileOverview.jsx
import React from 'react';
import './ProfileOverview.css';
import profilePic from '../assets/icons/pp.png';
import verifiedIcon from '../assets/icons/blue-tick.png';
import notifIcon from '../assets/icons/notif-icon.png';
import applicationIcon from '../assets/icons/application-icon.png';
import evalIcon from '../assets/icons/eval-icon.png';

const ProfileOverview = () => {
  const user = {
    name: 'Yahia Hesham',
    major: 'MET',
    status: 'pro',
    completedMonths: 2,       // out of 3
    totalMonths: 3,
    profileUrl: '/profile',
    cycle: {
      state: 'Active',
      start: 'March 1, 2025',
      end: 'June 1, 2025'
    }
  };

  const progress = (user.completedMonths / user.totalMonths) * 100;

  return (
    <div className="profile-overview-new">
      <header className="po-header">
        <img src={profilePic} alt="Profile" className="po-avatar" />

        <div className="po-name-wrap">
          {/* Name is now a clickable link */}
          <a href={user.profileUrl} className="po-name-link">
            <h2 className="po-name">{user.name}</h2>
          </a>
          {user.status === 'pro' && (
            <img src={verifiedIcon} alt="Pro verify" className="po-verified" />
          )}
        </div>
      </header>

      <div className="po-progress">
        <div className="po-progress-bar">
          <div
            className="po-progress-fill"
            style={{ width: `${progress}%` }}
          />
        </div>
        <span className="po-progress-text">
          {user.completedMonths} of {user.totalMonths} months completed
        </span>
      </div>

      <div className="po-cycle">
        <span className="po-cycle-label">Internship Cycle</span>
        <span className={`po-cycle-state ${user.cycle.state.toLowerCase()}`}>
          {user.cycle.state}
        </span>
        <p className="po-cycle-dates">
          {user.cycle.start} â€“ {user.cycle.end}
        </p>
      </div>

      <div className="po-nav">
        <button className="po-btn">
          <img src={notifIcon} alt="" /> Notifications
        </button>
        <button className="po-btn">
          <img src={applicationIcon} alt="" /> Applications
        </button>
        <button className="po-btn">
          <img src={evalIcon} alt="" /> Evaluations
        </button>
      </div>
    </div>
  );
};

export default ProfileOverview;
